import React from "react";
import styled from "styled-components";

const Container = styled.View`
  background-color: red;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  align-self: center
  margin: 20px;
`;

const Text = styled.Text`
  font-size: 30px;
  justify-content: center
  color: yellow;
  width: 60px;
  height: 50px;
`;

const TextArea = styled.View`
  justify-content: center;
  width: 60px
  height:50px
`;

const InputArea = styled.TextInput`
  background-color: black;
  color: white
  width: 200px;
  height: 50px;
  padding-left: 10px
`;

const IDPW = ({ title }) => {
  return (
    <Container>
      <TextArea>{title}</TextArea>
      <InputArea></InputArea>
    </Container>
  );
};

export default IDPW;
